import React, { useState } from 'react';

const CampusInsights = () => {
  const [timeframe, setTimeframe] = useState('week');

  const stats = {
    activeUsers: 3421,
    avgMood: 6.8,
    interventions: 247,
    sessions: 34
  };

  const departments = [
    { name: 'Computer Science', students: 2340, avgMood: 6.2, riskLevel: 'Medium' },
    { name: 'Engineering', students: 1890, avgMood: 6.5, riskLevel: 'Medium' },
    { name: 'Business', students: 2120, avgMood: 7.1, riskLevel: 'Low' },
    { name: 'Medicine', students: 980, avgMood: 5.8, riskLevel: 'High' }
  ];

  const alerts = [
    { location: 'Library - 3rd Floor', students: 8, severity: 'High', type: 'Academic Stress' },
    { location: 'Engineering Building', students: 12, severity: 'Medium', type: 'Exam Anxiety' },
    { location: 'Student Dormitories', students: 6, severity: 'High', type: 'Social Isolation' }
  ];

  return (
    <div style={{ padding: '40px' }}>
      <h1>Campus Mental Health Insights</h1>
      <p>Anonymous campus-wide mental wellness analytics and trend monitoring</p>

      {/* Controls */}
      <div style={{ marginBottom: '30px', padding: '20px', background: 'rgba(255,255,255,0.05)', borderRadius: '8px' }}>
        <label style={{ marginRight: '15px' }}>
          Timeframe: 
          <select value={timeframe} onChange={(e) => setTimeframe(e.target.value)} 
                  style={{ marginLeft: '8px', padding: '4px', background: 'rgba(255,255,255,0.1)', color: 'white', border: '1px solid rgba(255,255,255,0.3)' }}>
            <option value="day">Last 24 Hours</option>
            <option value="week">Last Week</option>
            <option value="month">Last Month</option>
          </select>
        </label>
      </div>

      {/* Key Metrics */}
      <div style={{ display: 'grid', gridTemplateColumns: 'repeat(auto-fit, minmax(200px, 1fr))', gap: '20px', marginBottom: '40px' }}>
        {[
          { title: 'Active Users', value: stats.activeUsers.toLocaleString(), change: '+12%', icon: '👥' },
          { title: 'Avg Mood Score', value: `${stats.avgMood}/10`, change: '+0.3', icon: '😊' },
          { title: 'Interventions', value: stats.interventions, change: '-8%', icon: '🧘‍♀️' },
          { title: 'Support Sessions', value: stats.sessions, change: '+15%', icon: '🤝' }
        ].map((stat, i) => (
          <div key={i} style={{
            background: 'rgba(255,255,255,0.1)',
            padding: '20px',
            borderRadius: '12px',
            textAlign: 'center'
          }}>
            <div style={{ fontSize: '2rem', marginBottom: '10px' }}>{stat.icon}</div>
            <h3 style={{ color: '#667eea', margin: '10px 0' }}>{stat.value}</h3>
            <p style={{ margin: '5px 0', opacity: 0.9 }}>{stat.title}</p>
            <small style={{ color: stat.change.startsWith('+') ? '#4caf50' : '#f44336' }}>
              {stat.change} from last {timeframe}
            </small>
          </div>
        ))}
      </div>

      <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr', gap: '30px' }}>
        {/* Department Analysis */}
        <div>
          <h3>Departmental Risk Assessment</h3>
          {departments.map((dept, i) => (
            <div key={i} style={{
              background: 'rgba(255,255,255,0.05)',
              padding: '15px',
              margin: '10px 0',
              borderRadius: '8px',
              border: '1px solid rgba(255,255,255,0.1)'
            }}>
              <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                <div>
                  <div style={{ fontWeight: 'bold' }}>{dept.name}</div>
                  <div style={{ fontSize: '12px', opacity: 0.7 }}>{dept.students.toLocaleString()} students</div>
                  <div style={{ fontSize: '12px' }}>Avg Mood: {dept.avgMood}/10</div>
                </div>
                <span style={{
                  padding: '4px 8px',
                  borderRadius: '4px',
                  fontSize: '12px',
                  background: dept.riskLevel === 'High' ? 'rgba(244,67,54,0.2)' : 
                            dept.riskLevel === 'Medium' ? 'rgba(255,152,0,0.2)' : 'rgba(76,175,80,0.2)',
                  color: dept.riskLevel === 'High' ? '#f44336' : 
                        dept.riskLevel === 'Medium' ? '#ff9800' : '#4caf50'
                }}>
                  {dept.riskLevel} Risk
                </span>
              </div>
            </div>
          ))}
        </div>

        {/* Risk Alerts */}
        <div>
          <h3>High-Risk Area Monitoring</h3>
          {alerts.map((alert, i) => (
            <div key={i} style={{
              background: alert.severity === 'High' ? 'rgba(244,67,54,0.1)' : 'rgba(255,152,0,0.1)',
              border: `1px solid ${alert.severity === 'High' ? 'rgba(244,67,54,0.3)' : 'rgba(255,152,0,0.3)'}`,
              padding: '15px',
              margin: '10px 0',
              borderRadius: '8px'
            }}>
              <div style={{ fontWeight: 'bold' }}>{alert.location}</div>
              <div style={{ fontSize: '14px', marginTop: '5px' }}>
                {alert.students} students showing {alert.type} indicators
              </div>
              <div style={{ fontSize: '12px', opacity: 0.7, marginTop: '5px' }}>
                Severity: {alert.severity}
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default CampusInsights;
